  {
    return Mock.listIsFull_CallbackFunctionPointer(list, Mock.listIsFull_CallbackCalls++);
  }
  UNITY_TEST_ASSERT_NOT_NULL(cmock_call_instance, cmock_line, "Function 'listIsFull' called more times than expected.");
